    <link rel="manifest" href="../manifest.webmanifest" />

      id="jupyter-lite-main"
      rel="preload"
      href="../build/lab/bundle.js?_=d427854"
      main="index"
      as="script"
    />
    <script
      id="jupyter-config-data"
      type="application/json"
      data-jupyter-lite-root=".."

        "appName": "Computational Genetic Genealogy",
        "appUrl": "./lab",
        "appVersion": "0.5.1",
        "baseUrl": "./",

        "faviconUrl": "./lab/favicon.ico",

        "filesCellMarker": "# %%",

            "codeCellConfig": {

            }
          },

          }
        }
      }

    <script>
      (async function () {
        const { pathname, origin, search, hash } = window.location;
        if (pathname.match(/(index.html|\/?)$/) == null) {
          window.location.href = `${origin}${pathname}/${search}${hash}`;
          return;
        }
        await import(
          '../config-utils.js?_=d427854'
        );
      }.call(this));
    </script>
